import base64
import hashlib


def get_md5_value(str):
    my_md5 = hashlib.md5()  # 获取一个MD5的加密算法对象
    my_md5.update(str)  # 得到MD5消息摘要
    hash = my_md5.hexdigest()  # 以16进制返回消息摘要，32位
    return hash


strs = ''

imgData = base64.b64decode(strs)

md5 = get_md5_value(imgData)

print('imgData：' + md5, len(md5))
